  return (
    <div className="bg-white border-bottom">
      <div className="container-fluid py-2 text-center">
        <img
          src="/itkc-header.png"
          alt="Info Tech Corporation of Goa"
          style={{
            maxWidth: "100%",
            height: "80px",
            objectFit: "contain",
          }}
        />
      </div>
    </div>
  );
}
